trix(1 0 0 1 44.7124 620.5592)"><tspan x="0" y="0" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">The golden-crowned kinglet (Regulus satrapa) is a very small songbird. Adults are </tspan><tspan x="0" y="16.2" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">olive-gray on the upperparts with white underparts, with thin bills and short tails. </tspan><tspan x="0" y="32.4" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">They have white wing bars, a black stripe through the eyes and a yellow crown </tspan><tspan x="0" y="48.6" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">surrounded by black. The adult male has an orange patch in the middle of the </tspan><tspan x="0" y="64.8" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">yellow crown. Their breeding habitat is coniferous forests across Canada, the </tspan><tspan x="0" y="81" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">northeastern and western United States, Mexico and Central America. They nest in </tspan><tspan x="0" y="97.2" fill="#42210B" font-family="'TwCenMT-Regular'" font-size="13.5px">a well-concealed hanging cup suspended from a conifer branch.</tspan></text>	</g>	<rect x="37.4" y="55" display="inline" fill="none" width="458.9" height="37"/>			<text id="name" transform="matrix(1 0 0 1 91.9973 77.8237)" display="inline" fill="#603813" font-family="'TwCenMT-Regular'" font-size="36px">Golden-crowned Kinglet</text>	<rect x="119.7" y="545" display="inline" fill="none" width="294.3" height="28"/>			<text id="scientificName" transform="matrix(1 0 0 1 187.2122 562.0371)" display="inline" fill="#603813" font-family="'Parisienne-Regular'" font-size="26px">Regulus satrapa</text></g><g id="Descriptions" display="none">			<text id="graphName" transform="matrix(1 0 0 1 539.22 146.9308)" display="inline" fill="#603813" font-family="'TwCenMT-Bold'" font-size="26px">{{   chosenItemInfo[chosenItem].text
